import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router/dom"; // INCORRECTO


import Register from "./views/Register"; // Asegúrate de que la ruta del import sea correcta

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/register" element={<Register />} />
            </Routes>
        </Router>
    );
};

export default App;
